import './Home.css';

function Home() {
  return (
    <div className="home-container">
      <h1>Welcome to TalentHub</h1>
      <p>Showcase your talent. Discover great performers. Connect instantly.</p>

      <div className="home-buttons">
        <a href="/upload" className="home-btn upload-btn">Upload Your Talent</a>
        <a href="/directory" className="home-btn browse-btn">Browse Talent</a>
      </div>
    </div>
  );
}

export default Home;
